import axios from 'axios'
import { useEffect, useState } from 'react'
import styles from './App.module.scss';
import Layout from './LayOut';
import { Link } from 'react-router-dom'

function App() {
  const [code, setCode] = useState('')
  const [submitCode, setSubmitCode] = useState('');
  const [size, setSize] = useState('');
  const [submitSize, setSubmitSize] = useState('');

  const handleClick = () => {
    setSubmitCode(code)
    setSubmitSize(size)
  }

  return (
    <div>
      <div className={styles.header}>
        {/* <GetDataFromSoldOut submitCode={submitCode} />
      <GetDataFromSNKRDUNK submitCode={submitCode} /> */}
        <input
          className={styles.input}
          value={code}
          onChange={(e) => setCode(e.target.value)}
        />
        <input
          className={styles.input}
          style={{width: '50px'}}
          value={size}
          onChange={(e) => setSize(e.target.value)}
        />
        <button className={styles.btn} onClick={handleClick}>Submit</button>
      </div>
      <div className={styles.wrapper}>
        <Layout submitCode={submitCode} size={submitSize} />
      </div>
      <div className={styles.modal}></div>
    </div>
  );
}

export default App;
